DROP TABLE IF EXISTS `hhs_share_pay_info`;
CREATE TABLE `hhs_share_pay_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(60) DEFAULT '',
  `message` varchar(1000) DEFAULT '',
  `money` decimal(10,2) NOT NULL,
  `user_id` int(11) NOT NULL DEFAULT '0',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `addtime` int(11) unsigned NOT NULL DEFAULT '0',
  `order_id` int(11) unsigned NOT NULL DEFAULT '0',
  `is_paid` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


























































































DROP TABLE IF EXISTS `hhs_shipping`;
CREATE TABLE `hhs_shipping` (
  `shipping_id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT,
  `shipping_code` varchar(20) NOT NULL DEFAULT '',
  `shipping_name` varchar(120) NOT NULL DEFAULT '',
  `shipping_desc` varchar(255) NOT NULL DEFAULT '',
  `insure` varchar(10) NOT NULL DEFAULT '0',
  `support_cod` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `enabled` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `shipping_print` text NOT NULL,
  `print_bg` varchar(255) DEFAULT NULL,
  `config_lable` text,
  `print_model` tinyint(1) DEFAULT '0',
  `shipping_order` tinyint(3) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`shipping_id`),
  KEY `shipping_code` (`shipping_code`,`enabled`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;








DROP TABLE IF EXISTS `hhs_shipping_area`;
CREATE TABLE `hhs_shipping_area` (
  `shipping_area_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `shipping_area_name` varchar(150) NOT NULL DEFAULT '',
  `shipping_id` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `supp_id` smallint(5) NOT NULL DEFAULT '0',
  `configure` text NOT NULL,
  PRIMARY KEY (`shipping_area_id`),
  KEY `shipping_id` (`shipping_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;






























DROP TABLE IF EXISTS `hhs_shipping_point`;
CREATE TABLE `hhs_shipping_point` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `province` smallint(5) unsigned NOT NULL DEFAULT '0',
  `city` smallint(5) unsigned NOT NULL DEFAULT '0',
  `district` smallint(5) unsigned NOT NULL DEFAULT '0',
  `address` varchar(300) NOT NULL,
  `shop_name` varchar(300) DEFAULT NULL,
  `longitude` varchar(100) NOT NULL,
  `latitude` varchar(100) NOT NULL,
  `tel` varchar(30) NOT NULL,
  `suppliers_id` int(10) NOT NULL,
  `wx_name` varchar(100) NOT NULL,
  `wx_openid` varchar(100) NOT NULL,
  `has_printer` tinyint(1) DEFAULT '0',
  `printer_type` varchar(20) DEFAULT NULL,
  `device_no` varchar(200) DEFAULT NULL,
  `device_code` varchar(200) DEFAULT NULL,
  `device_key` varchar(200) DEFAULT NULL,
  `mobile` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;













DROP TABLE IF EXISTS `hhs_shipping_point_user`;
CREATE TABLE `hhs_shipping_point_user` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `point_id` int(10) NOT NULL,
  `openid` varchar(200) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `point_id` (`point_id`),
  KEY `openid` (`openid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
















DROP TABLE IF EXISTS `hhs_shop_config`;
CREATE TABLE `hhs_shop_config` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` smallint(5) unsigned NOT NULL DEFAULT '0',
  `code` varchar(30) NOT NULL DEFAULT '',
  `type` varchar(10) NOT NULL DEFAULT '',
  `store_range` varchar(255) NOT NULL DEFAULT '',
  `store_dir` varchar(255) NOT NULL DEFAULT '',
  `value` text NOT NULL,
  `sort_order` tinyint(3) unsigned NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `code` (`code`),
  KEY `parent_id` (`parent_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;








































































































































































DROP TABLE IF EXISTS `hhs_site`;
CREATE TABLE `hhs_site` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `province_id` varchar(10) NOT NULL,
  `city_id` varchar(10) NOT NULL,
  `name` varchar(100) NOT NULL,
  `close` int(10) NOT NULL DEFAULT '0',
  `keywords` varchar(100) NOT NULL,
  `description` varchar(255) NOT NULL,
  `site_logo` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;






DROP TABLE IF EXISTS `hhs_snatch_log`;
CREATE TABLE `hhs_snatch_log` (
  `log_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `snatch_id` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `bid_price` decimal(10,2) NOT NULL DEFAULT '0.00',
  `bid_time` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`log_id`),
  KEY `snatch_id` (`snatch_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `hhs_stats`;
CREATE TABLE `hhs_stats` (
  `access_time` int(10) unsigned NOT NULL DEFAULT '0',
  `ip_address` varchar(15) NOT NULL DEFAULT '',
  `visit_times` smallint(5) unsigned NOT NULL DEFAULT '1',
  `browser` varchar(60) NOT NULL DEFAULT '',
  `system` varchar(20) NOT NULL DEFAULT '',
  `language` varchar(20) NOT NULL DEFAULT '',
  `area` varchar(30) NOT NULL DEFAULT '',
  `referer_domain` varchar(100) NOT NULL DEFAULT '',
  `referer_path` varchar(200) NOT NULL DEFAULT '',
  `access_url` varchar(255) NOT NULL DEFAULT '',
  KEY `access_time` (`access_time`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;







































































































































































DROP TABLE IF EXISTS `hhs_supp_account`;
CREATE TABLE `hhs_supp_account` (
  `account_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `account_name` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `role` varchar(255) DEFAULT NULL,
  `suppliers_id` int(10) NOT NULL COMMENT '所创建的经销商ID',
  `sort_order` int(10) NOT NULL DEFAULT '50' COMMENT '排序',
  `is_check` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `account_password` varchar(100) NOT NULL,
  `account_type` int(10) NOT NULL DEFAULT '0',
  `address` varchar(288) NOT NULL,
  `phone` varchar(30) NOT NULL,
  `sort` int(11) DEFAULT '1' COMMENT '排序',
  PRIMARY KEY (`account_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;




























































DROP TABLE IF EXISTS `hhs_supp_action`;
CREATE TABLE `hhs_supp_action` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `action` varchar(100) NOT NULL,
  `action_name` varchar(30) NOT NULL,
  `action_link` varchar(30) NOT NULL,
  `action_act` varchar(30) NOT NULL,
  `parent_id` varchar(30) NOT NULL,
  `sort` int(10) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


























DROP TABLE IF EXISTS `hhs_supp_config`;
CREATE TABLE `hhs_supp_config` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `suppliers_id` varchar(10) NOT NULL,
  `shipping_type` varchar(10) NOT NULL,
  `shipping_fee` decimal(10,2) NOT NULL,
  `bank_name` varchar(100) NOT NULL,
  `bank_p_name` varchar(100) NOT NULL,
  `bank_account` varchar(100) NOT NULL,
  `bank_password` varchar(100) NOT NULL COMMENT '提现密码',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
















































DROP TABLE IF EXISTS `hhs_supp_photo`;
CREATE TABLE `hhs_supp_photo` (
  `photo_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `photo_file` varchar(255) DEFAULT NULL,
