DROP TABLE IF EXISTS `hhs_supp_urls`;
CREATE TABLE `hhs_supp_urls` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `url` text,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;







DROP TABLE IF EXISTS `hhs_suppliers`;
CREATE TABLE `hhs_suppliers` (
  `suppliers_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `suppliers_name` varchar(255) DEFAULT NULL,
  `suppliers_desc` mediumtext,
  `is_check` tinyint(2) unsigned NOT NULL DEFAULT '2' COMMENT '-1未过，1已过，2再审',
  `qq` varchar(30) NOT NULL,
  `city_id` varchar(10) NOT NULL,
  `province_id` varchar(10) NOT NULL,
  `supp_logo` varchar(100) NOT NULL,
  `supp_banner` varchar(100) NOT NULL,
  `district_id` varchar(10) NOT NULL,
  `address` varchar(100) NOT NULL,
  `phone` varchar(30) NOT NULL,
  `email` varchar(30) NOT NULL,
  `announcement` varchar(255) NOT NULL,
  `rank_id` varchar(10) NOT NULL,
  `password` varchar(40) NOT NULL,
  `user_name` varchar(30) NOT NULL,
  `business_license` varchar(100) NOT NULL,
  `cards` varchar(100) NOT NULL,
  `show_type` int(10) NOT NULL,
  `business_scope` varchar(100) NOT NULL COMMENT '组织机构代码证',
  `map_info` varchar(30) NOT NULL,
  `real_name` varchar(30) NOT NULL,
  `identification_card` varchar(100) NOT NULL,
  `company_name` varchar(100) NOT NULL,
  `business_license_number` varchar(100) NOT NULL,
  `certificate` varchar(100) NOT NULL COMMENT '税务登记证',
  `check_desc` varchar(255) NOT NULL,
  `phone1` varchar(30) NOT NULL,
  `email1` varchar(30) NOT NULL,
  `is_top` int(10) NOT NULL DEFAULT '0',
  `sort_order` int(10) NOT NULL DEFAULT '0',
  `is_delete` int(10) NOT NULL DEFAULT '0',
  `is_oneshow` int(10) NOT NULL DEFAULT '0',
  `is_twoshow` int(10) NOT NULL DEFAULT '0',
  `comprehensive_score` int(10) NOT NULL DEFAULT '0' COMMENT '综合',
  `description_score` int(10) NOT NULL DEFAULT '0' COMMENT '描述',
  `service_score` int(10) NOT NULL DEFAULT '0' COMMENT '服务',
  `delivery_score` int(10) NOT NULL DEFAULT '0' COMMENT '发货',
  `factory_authorized` text NOT NULL,
  `url_name` varchar(100) NOT NULL COMMENT '二级域名',
  `supp_type` tinyint(1) NOT NULL COMMENT '商家类型(0默认商家/1个人商家/2厂家商家)',
  `supp_type_id` int(10) NOT NULL COMMENT '个人ID或厂家ID',
  `recommend_person` varchar(25) NOT NULL COMMENT '推荐人',
  `recommend_supp` varchar(25) NOT NULL COMMENT '推荐商家',
  `add_time` varchar(15) NOT NULL COMMENT '添加时间',
  `shopowner_phone` varchar(15) DEFAULT NULL COMMENT '店长手机',
  `longitude` varchar(100) NOT NULL,
  `latitude` varchar(100) NOT NULL,
  `openid` varchar(300) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `percentage` decimal(10,2) DEFAULT NULL COMMENT '佣金比例',
  PRIMARY KEY (`suppliers_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


































































DROP TABLE IF EXISTS `hhs_suppliers_accounts`;
CREATE TABLE `hhs_suppliers_accounts` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `suppliers_id` int(10) NOT NULL,
  `settlement_status` int(10) NOT NULL DEFAULT '0' COMMENT '结算状态 1待审核 2已审核  3已付款待确认  4已完成',
  `start_time` varchar(30) NOT NULL,
  `end_time` varchar(30) NOT NULL,
  `total` decimal(10,2) DEFAULT '0.00' COMMENT '总金额',
  `settlement_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '结算总额',
  `commission` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '结算佣金',
  `add_time` varchar(30) NOT NULL COMMENT '结算时间',
  `add_month` varchar(30) NOT NULL,
  `settlement_sn` varchar(30) NOT NULL COMMENT '结算单号',
  `remark` text,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;














DROP TABLE IF EXISTS `hhs_suppliers_accounts_apply`;
CREATE TABLE `hhs_suppliers_accounts_apply` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `account` decimal(10,2) NOT NULL,
  `suppliers_id` varchar(10) NOT NULL,
  `bank_name` varchar(100) NOT NULL,
  `add_time` varchar(30) NOT NULL,
  `apply_desc` text NOT NULL,
  `pay_time` varchar(30) NOT NULL,
  `apply_status` varchar(10) NOT NULL DEFAULT '0',
  `rec_id` varchar(100) NOT NULL,
  `bank_p_name` varchar(100) NOT NULL,
  `bank_account` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `hhs_suppliers_accounts_detal`;
CREATE TABLE `hhs_suppliers_accounts_detal` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(30) NOT NULL,
  `order_id` varchar(30) NOT NULL,
  `order_time` varchar(30) NOT NULL,
  `amount` decimal(10,2) NOT NULL,
  `commission` decimal(10,2) NOT NULL COMMENT '佣金',
  `suppliers_accounts_id` int(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
















































































DROP TABLE IF EXISTS `hhs_suppliers_accounts_log`;
CREATE TABLE `hhs_suppliers_accounts_log` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `add_time` int(11) NOT NULL,
  `admin_id` varchar(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;















DROP TABLE IF EXISTS `hhs_tag`;
CREATE TABLE `hhs_tag` (
  `tag_id` mediumint(8) NOT NULL AUTO_INCREMENT,
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `tag_words` varchar(255) NOT NULL DEFAULT '',
  PRIMARY KEY (`tag_id`),
  KEY `user_id` (`user_id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `hhs_template`;
CREATE TABLE `hhs_template` (
  `filename` varchar(30) NOT NULL DEFAULT '',
  `region` varchar(40) NOT NULL DEFAULT '',
  `library` varchar(40) NOT NULL DEFAULT '',
  `sort_order` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `id` smallint(5) unsigned NOT NULL DEFAULT '0',
  `number` tinyint(1) unsigned NOT NULL DEFAULT '5',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `theme` varchar(60) NOT NULL DEFAULT '',
  `remarks` varchar(30) NOT NULL DEFAULT '',
  KEY `filename` (`filename`,`region`),
  KEY `theme` (`theme`),
  KEY `remarks` (`remarks`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `hhs_topic`;
CREATE TABLE `hhs_topic` (
  `topic_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL DEFAULT '''''',
  `intro` text NOT NULL,
  `start_time` int(11) NOT NULL DEFAULT '0',
  `end_time` int(10) NOT NULL DEFAULT '0',
  `data` text NOT NULL,
  `template` varchar(255) NOT NULL DEFAULT '''''',
  `css` text NOT NULL,
  `topic_img` varchar(255) DEFAULT NULL,
  `title_pic` varchar(255) DEFAULT NULL,
  `base_style` char(6) DEFAULT NULL,
  `htmls` mediumtext,
  `keywords` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  KEY `topic_id` (`topic_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `hhs_user_account`;
CREATE TABLE `hhs_user_account` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `admin_user` varchar(255) NOT NULL,
  `amount` decimal(10,2) NOT NULL,
  `add_time` int(10) NOT NULL DEFAULT '0',
  `paid_time` int(10) NOT NULL DEFAULT '0',
  `admin_note` varchar(255) NOT NULL,
  `user_note` varchar(255) NOT NULL,
  `process_type` tinyint(1) NOT NULL DEFAULT '0',
  `payment` varchar(90) NOT NULL,
  `is_paid` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `is_paid` (`is_paid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



